import React from 'react';
import { Formik, Field, Form } from "formik";
import './form.css';

export class FormContact extends React.Component {
    render() {
        return (
            <Formik
                initialValues={{ contact_name: '', contact_surname: '', contact_phone: ''}}
            >
                <Form className='form-contact'>
                    <span className='form-legend'>Данные контакта</span>
                    <label htmlFor='contact-name'>Имя</label>
                    <Field type='text' id='contact-name' name='contact-name'/>
                    <label htmlFor='contact-surname'>Фамилия</label>
                    <Field type='text' id='contact-surname' name='contact-surname'/>
                    <label htmlFor='contact-phone'>Телефон</label>
                    <Field type='email' id='contact-phone' name='contact-phone'/>
                    <div className='form-controls'>
                        <button className='button-save'>Сохранить</button>
                        <button className='button-cancel'>Отмена</button>
                    </div>
                </Form>
            </Formik>
        );
    }
}
